import React from "react";
import "./style.css";
import { Link } from "react-router-dom";
import { Button } from "reactstrap";

export default function HomePage() {
  return (
    <>
      <div className="label">Facilite as suas permutas j√°!</div>
      <div className="container">
        <div className="buttonContainer">
          <div className="buttons">
            <Link to="/logon">
              <Button>
                style=
                {{
                  width: "100px",
                  fontSize: "20px",
                  color: "black",
                  fontFamily: "PMingLiU-ExtB",
                  position: "absolute",
                }}
                Login
              </Button>
            </Link>
            <Link to="/register">
              <Button>
                style=
                {{
                  width: "100px",
                  fontSize: "20px",
                  color: "black",
                  fontFamily: "PMingLiU-ExtB",
                  position: "absolute",
                  marginLeft: "100px",
                }}
                Cadastro
              </Button>
            </Link>
          </div>
        </div>
      </div>
    </>
  );
}
